import React from 'react';
import {
    Navbar,
    Container
 } from 'react-bootstrap';

class NavBar extends React.Component {
    render() {
        const NavStyle = {
            background: '#D6B064',
            height: '85px',
            fixed: 'top',
        }
        return (
            <Navbar style={NavStyle} >
                <Container>
                    <Navbar.Brand>
                        <img
                            alt="DialexaBVG"
                            src="/assets/dialexarobot.png"
                            className="d-inline-block align-top"
                            height
                        />
                    </Navbar.Brand>
                </Container>
            </Navbar>
        );
    }
}

export default NavBar;
